CREATE TABLE IF NOT EXISTS `staticdynels` (
  `Id` int(10) NOT NULL AUTO_INCREMENT,
  `Type` int(10) NOT NULL DEFAULT '0',
  `Instance` int(10) NOT NULL DEFAULT '0',
  `Playfield` int(10) NOT NULL DEFAULT '0',
  `X` float NOT NULL DEFAULT '0',
  `Y` float NOT NULL DEFAULT '0',
  `Z` float NOT NULL DEFAULT '0',
  `HeadingX` float NOT NULL DEFAULT '0',
  `HeadingY` float NOT NULL DEFAULT '0',
  `HeadingZ` float NOT NULL DEFAULT '0',
  `HeadingW` float NOT NULL DEFAULT '0',
  `stats` blob,
  `customevents` blob,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=295 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

DELETE FROM `staticdynels`;
